import React from 'react'
import './DisplayArea.css'

const DisplayArea = () =>{
    let items = ['one',"two","three","four"]
    return(
            <div className="disp">
                    <div>
                        {
                            items.map((val,i)=>{
                                return(<h1 key = {i}>
                                    {val}
                                </h1>);
                            })
                        }
                        
                    </div>
                    <hr/>
                    <div className="form">
                        <input id="inp" placeholder="Enter your message here">
                        </input>
                        <button>send</button>
                    </div>
            </div>
    );
}

export default DisplayArea;
